import {createBottomTabNavigator} from "@react-navigation/bottom-tabs";
import {Button, FlatList, StyleSheet, Text, TextInput, View, RefreshControl, TouchableOpacity, Image} from "react-native";
import {NavigationContainer} from "@react-navigation/native";
import axios from "axios";
import {useCallback, useEffect, useState} from "react";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import * as ImagePicker from 'expo-image-picker';


const Tab = createBottomTabNavigator();

const Home = ({navigation}) => {
    const memberId =1;
    const [items, setItems] = useState(null);
    const [refreshing, setRefreshing] = useState(false);

    const onRefresh = useCallback(() => {
      setRefreshing(true);
      axios.get("http://localhost:8080/items")
      .then(result => setItems(result.data))
      .catch(err => console.log(err));
      setTimeout(() => {
        setRefreshing(false);
      }, 2000);
    }, []);


    useEffect(()=>{
        axios.get("http://localhost:8080/items")
            .then(result => setItems(result.data))
            .catch(err => console.log(err.data));
    },[])

    return (
        <FlatList data={items}
                  refreshControl={
                    <RefreshControl refreshing={refreshing} onRefresh={onRefresh}/>
                  }

                  keyExtractor={(item) => item.itemId}
                  renderItem={({item}) =>
                      <TouchableOpacity 
                          onPress={()=>navigation.navigate("Item",{
                            itemId:item.itemId,
                            memberId : memberId
                          })}
                          style = {styles.itemBox}>

                        <Text style={styles.itemName}>{item.itemName}</Text>
                        <Text>{item.city}{item.gu} {item.dong}</Text>
                        <Text>{item.createDate}</Text>
                        <Text style = {styles.itemPrice}>{item.price} 원   관심수 : {item.interestCount}</Text>
                        <Text>{item.uri}</Text>

                      </TouchableOpacity>}/>

    );
};

const Life = () => {
  return (
      <View>
        <Text>동네 생활 페이지</Text>
      </View>
  );
};

const ItemRegisterPage = ({navigation}) =>{

    const [itemName, onChangeName] = useState("제목을 입력하세요");
    const [price, onChangePrice] = useState("가격을 입력하세요");
    const [content, onChangeContent] = useState("내용을 입력하세요");
    const memberId = 1;
    const [image, setImage] = useState(null);
    const pickImage = async () =>{
    let result = await ImagePicker.launchImageLibraryAsync({
      mediaTypes:ImagePicker.MediaTypeOptions.All,
      allowsEditing:true,
      quality:1
    }
    );

    console.log("image = " + result);
    if(!result.canceled){
      setImage(result.assets[0].uri);
    }

  }
  return (
      <View>
          <View style={{marginVertical:10,
                        marginHorizontal:10
          }}>
            <View>

            <Button title="add your image" onPress={pickImage}/>
            {image && <Image source={{uri : image}} style = {{width: 100, height: 100 }}/>}
            </View>


              <Text style={
                styles.text
              }>제목
              </Text>
              <TextInput
                  keyboardType="web-search"
                  style={styles.input}
                  onChangeText={onChangeName}
                  value={itemName}/>

              <Text style={
                styles.text
              }>
                가격
              </Text>
              <TextInput

                style={styles.input}
                onChangeText={onChangePrice}
                value={price}
                keyboardType="numeric"
              />
              <Text style={
                styles.text
              }>
                내용
              </Text>
              <TextInput
                style = {styles.input}
                onChangeText={onChangeContent}
                value = {content}
              />
          </View>



        <Button title="Create Item" onPress={()=>{
          const formData = new FormData();
          formData.append('memberId', memberId);
          formData.append('itemName', itemName);
          formData.append('price', price);
          formData.append('content', content);
          formData.append('image', {
            uri:image,
            name:'image.png',
            type:'image/png'
          });
          const boundary = `---------------------------${Math.random().toString(16).substr(2, 16)}`; 


            axios.post("http://localhost:8080/items/new",
               formData,{
                    headers: {
                      'Content-Type': `multipart/form-data; boundary=${boundary}`
                    }
                }
            ).then(()=>{
              onChangeName("제목을 입력하세요");
              onChangePrice("가격을 입력하세요");
              onChangeContent("내용을 입력하세요");
                console.log("success");
                console.log(itemName);
                console.log(price);
              navigation.navigate("홈")
            }).catch((error) => console.log(error));
        }}/>
      </View>
  );
};

const MyPage = () =>{
  return (
      <View>
        <Text>My page</Text>
      </View>
  );
};


function Item({navigation,route}) {

  const {itemId, memberId} =route.params;
  const [item, setItem] = useState(null);
  const url = "http://localhost:8080/items/" + itemId ;
  const [like, setLike] = useState(false);

  useEffect(()=>{
    const getResponse = async () =>{
      const response = await axios.get(url);
      setItem(response.data);
    };
    getResponse();
  },[]);

  if(item == null){
    return <Text>로딩중</Text>
  }

  return (

    <View style={{
      flex:1
    }}>

      <View style ={{borderBottomWidth : 1,
                 flex:1
                    }}>
        <View style={{marginLeft : 14,
                     marginVertical:10 }}>
        <Text style = {{fontSize : 20}}>{item.sellerName}</Text>
        <Text>{item.gu}구 {item.dong}</Text>
        </View>
      </View>

      <View style={{flex:10}}>
        <Text style={{
          marginLeft:15,
          fontSize : 30,
          marginVertical : 10
        }}>{item.itemName}</Text>

        <Text style={{
          marginLeft:15,
          marginVertical:10
        }}>등록일 {item.createDate}
        </Text>

        <Text style={{
          marginLeft:15
        }}>{item.content}</Text>
      </View>

      <View style={{position:"absolute",
                    left:0,
                    right:0,
                    bottom:20,
                    height:40,
                    backgroundColor:"yellow",
                    alignItems:"center"
                    }}>
          {like?(
            <Text>like</Text>
          ):(
            <Text>not like</Text>
          )}

        <Button title="like button" 
          onPress={
            () => {

              setLike(!like);

              const data = JSON.stringify({like,memberId});
              console.log(data)
              axios.put(
                url + "/like",
                data,
                {
                  headers: {
                      'Content-Type': 'application/json'
                  }
                }
              ).then(
                console.log("success")
              ).catch(err => console.log(err));
            }


          }
        />

      </View>
    </View>

  );
}

const Stack = createNativeStackNavigator();

const Base = () =>{
  return(
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen
          name = "MyTabs"
          component={MyTabs}
          options={{ headerShown: false }}/>
          <Stack.Screen name = "Item" component={Item} />
        </Stack.Navigator>
      </NavigationContainer>
  );
}

const LoginPage = ({navigation}) =>{

  const [loginId, setLoginId] = useState(null);
  const [password, setPassword] = useState(null);
  return (
    <View>
      <Text
        style={{margin:12,
                fontSize:20,
                fontWeight:"bold"
        }}
      >아이디</Text>
       <TextInput
              autoCapitalize="none"
              style={styles.input}
              onChangeText={setLoginId}
              value={loginId}/>

      <Text
        style={{margin:12,
                fontSize:20,
                fontWeight:"bold"
        }}
      >비밀번호</Text>
       <TextInput
              autoCapitalize="none"
              style={styles.input}
              onChangeText={setPassword}
              value={password}/>
      <Button

        title="로그인"
        onPress={()=> console.log("hello login")}
      />
    </View>
  )
}

const MyTabs = () =>{

  const Stack = createNativeStackNavigator();

  return (

      <Tab.Navigator>
        <Tab.Screen name="홈" component={Home}/>
        <Tab.Screen name="동네생활" component={Life}/>
        <Tab.Screen name="아이템 등록 페이지" component={ItemRegisterPage}/>
        <Tab.Screen name="나의 당근이지" component={MyPage}/>
        <Tab.Screen name ="로그인" component={LoginPage}/>
      </Tab.Navigator>




  );
};

const styles = StyleSheet.create({
  container:{
    flex:1,
    backgroundColor:"#708090"
  },

  itemBox : {
    marginHorizontal:20,
    marginVertical:10,
    paddingVertical: 10,
    borderBottomWidth : 1,
  },
  itemName : {
    fontSize:20,
    padding:2
  },

  itemPrice : {
    fontSize:20,
    padding:2,
    fontWeight : "bold"
  },
  input :{
      height:40,
      margin:12,
      borderWidth:1,


  },
  text : {
    fontSize:20,
    padding:10
  },
  // item detail
  id_memberBox : {
    marginVertical : 10,
    borderBottomWidth : 2
  },

})

export default Base;
